let state = {
  //posts

  profilePage: {
    postsData: [
      { id: 1, message: "Hi, i am john", likesCount: 12 },
      { id: 2, message: "welcome", likesCount: 18 },
    ],
  },
  ///dialogs
  dialogsPage: {
    dialogsData: [
      { id: 1, name: "John" },
      { id: 2, name: "Alan" },
      { id: 3, name: "Alex" },
      { id: 4, name: "Sofia" },
    ],
    messagesData: [
      { id: 1, message: "hi" },
      { id: 2, message: "hello" },
      { id: 3, message: "how are you" },
    ],
  },
};
///

export default state;
